import styled from "styled-components";

export const Container = styled.div`
  color: red;
  text-align: center;
  justify-content: center;

  input {
    padding: 15px;
    background-color: #00fa9a;
    display: flex;
    border-radius: 5px;
    flex-wrap: wrap;
    height: 100%;
    left: 100%;
    justify-content: center;
  }
`;
